import React from "react";

import "./TodoListLayout.css";

interface ListLayoutProps {
    children: {
        props: object;
    }
    type: "active" | "finished";
} 

const TodoListLayout: React.FC<ListLayoutProps> = ({type, children}) => {
    console.log(children.props.items.length);

    const isActive = type === "active";

    const contentToRender = children.props.items.length === 0 ? <p>something</p> : children;

    return(
        <div className="todos-layout">
            <h2 className={isActive ? "active" : "finished"}>{isActive ? "ACTIVE TODOS" : "FINISHED TODOS"}</h2>
            {contentToRender}
        </div>
    );
}

export default TodoListLayout;
